import { Component, OnInit } from "@angular/core";

@Component({
  selector: "app-title",
  templateUrl: "./title.component.html",
  styleUrls: ["./title.component.css"],
})
export class TitleComponent implements OnInit {
  nome:string = "evandro";
  constructor() {}
  ngOnInit(): void {
    this.nome = `Olá ${this.nome}`;
    console.log("Testando o OnInit");
  }
}
